import React from "react";
import { useParams } from "react-router-dom";

const CoinDetails = ({ coins }) => {
  const { coinId } = useParams();

  return (
    <>
      <span>{coins.symbol}</span>
      <h1>{coins.name}</h1>
      {coinId}
    </>
  );
};

export default CoinDetails;
